import React from 'react'
import { connect } from 'react-redux'

class DashboardConfig extends React.Component {
    

    input = () => {
        return (
            <div>
            <label>test</label>
            <input>
            </input>
            </div>
        )
    }

    render() {
        const [open] = React.useState(false);
        const listStyle = {
            listStyle: 'none',
        }
        const listElementStyle = {
            paddingTop: '1rem'
        }
        const user  = this.props.auth.user;
        return(
            <div>
                <p>Modify user informations :</p>
                <ul style={listStyle}>
                    <li style={listElementStyle}>
                        Name
                    </li>
                    {this.input()}
                    <li style={listElementStyle}>
                        Surname
                    </li>
                    <li style={listElementStyle}>
                        Phone
                    </li>
                    <li style={listElementStyle}>
                        Address
                    </li>
                </ul>
            </div>
        )
    }
}

const mapStateToProps = state => ({
    auth: state.auth
  });

export default connect(mapStateToProps)(DashboardConfig);
